\begin{eqnarray}
    \Delta_1(p)_{n,l}
    \!\!\!&=&\!\!\! -p^2+\sum^{l-1}_{q=2}\frac{(-i)^q}{q!}
    {\cal D}^q X\!\circ\!\left(\frac{\partial}{\partial p}\right)^q
    \!+\!\sum^{n-1}_{q=1}\frac{3(-i)^{2+q}(1+q)}{(2+q)!}
    \left[{\cal D}^{(q)}\cdot Y\right]
    \!\circ\!\left(\frac{\partial}{\partial p}\right)^q
    \nonumber\\ \nonumber &&
    +\sum^{n-1}_{q=1}\frac{2(-i)^q(1+q)}{(2+q)!}
    p\cdot
    \left[
    {\cal D}^q Y
    \circ\left(\frac{\partial}{\partial p}\right)^{1+q}\right]
    \\  &&
    +\sum^{n-1}_{r=0}\sum^{n-1}_{q=0}
    (1-\delta_{r0}\delta_{q0})
    \frac{(-i)^{2+r+q}(1+r)(1+q)}{(2+r)!(2+q)!}
    \nonumber\\ &&
    \;\;\;\;\;\;\;\;\;\;\;\;\;\;\;
    \times\left[
    {\cal D}^r Y
    \circ\left(\frac{\partial}{\partial p}\right)^{1+r}\right]
    \cdot
    \left[
    {\cal D}^q Y
    \circ\left(\frac{\partial}{\partial
    p}\right)^{1+q}\right].\nonumber\\\label{qDf}
