\begin{eqnarray}
P(s) &=& \dot{X}\cdot Y^{-3}\left(Ys+i\tan iYs\right) \cdot \dot{X} + \frac{1}{2}\mathrm{tr}\ln \sec iYs
\label{Ps}
\\
Q(s) &=& 2i \dot{X}\cdot Y^{-2}\left( 1 - \sec iYs\right)
\label{Qs}
\\
R(s) & = & 2 i Y^{-1} \tan iYs
\label{Rs}
\

